tmpls.qfmt:
{{Where to use it}}
<span asked="Effect,Returns" generator="instruction" template="eval">
 <header>
  <H1>
   {{#Language}}
   <span class="Language">
    {{Language}}
   </span>   {{/Language}}
   {{#Context}}
   {{#Language}}
   :
   {{/Language}}
   {{/Context}}
   {{#Context}}
   <span class="Context">
    {{Context}}
   </span>   {{/Context}}
  </H1>
 </header> <link href="_github.css" rel="stylesheet"/>
 <script src="_highlight.pack.js">
 </script> <script src="_highlight_automatic.js">
 </script> {{#Name}}
 <H2>
  <span class="Name">
   {{Name}}
  </span>
 </H2> <br/>
 {{/Name}}
 {{#Intuition}}
 <span class="Intuition">
  Intuition
 </span> :
 <span class="Intuition">
  {{Intuition}}
 </span> <hr/>
 {{/Intuition}}
 <table>
  {{#Library}}
  <tr>
   <td>
    <span class="context">
     Library
    </span>
   </td>   <td>
    <span class="context">
     {{Library}}
    </span>
   </td>
  </tr>  {{/Library}}
  {{#Where to use it}}
  <tr>
   <td>
    <span class="context">
     Where to use it
    </span>
   </td>   <td>
    <span class="context">
     {{Where to use it}}
    </span>
   </td>
  </tr>  {{/Where to use it}}
 </table> {{#Where to use it}}
 <hr/>
 {{/Where to use it}}
 {{^Where to use it}}
 {{#Library}}
 <hr/>
 {{/Library}}
 {{/Where to use it}}
 <table>
  {{#Instruction}}
  <tr>
   <td>
    <span class="Notation">
     Instruction
    </span>
   </td>   <td>
    <span class="Notation">
     {{#Language}}
     <pre><code class="{{Language}}"><span class="Instruction">{{Instruction}}</span></code></pre>     {{/Language}}
     {{^Language}}
     <span class="Instruction">
      {{Instruction}}
     </span>     {{/Language}}
    </span>
   </td>
  </tr>  {{/Instruction}}
  {{#Abbreviation}}
  <tr>
   <td>
    <span class="Abbreviation">
     Abbreviation
    </span>
   </td>   <td>
    <span class="Abbreviation">
     {{Abbreviation}}
    </span>
   </td>
  </tr>  {{/Abbreviation}}
 </table> {{#Abbreviation}}
 <hr/>
 {{/Abbreviation}}
 {{^Abbreviation}}
 {{#Instruction}}
 <hr/>
 {{/Instruction}}
 {{/Abbreviation}}
 <table>
  {{#Returns}}
  <tr>
   <td>
    <span class="Question Emphasize Returns">
     Returns
    </span>
   </td>   <td>
    <markofquestion>
    </markofquestion>
   </td>
  </tr>  {{/Returns}}
  {{#Effect}}
  <tr>
   <td>
    <span class="Question Emphasize Effect">
     Effect
    </span>
   </td>   <td>
    <markofquestion>
    </markofquestion>
   </td>
  </tr>  {{/Effect}}
  {{#Typ}}
  <tr>
   <td>
    <span class="Typ">
     Type
    </span>
   </td>   <td>
    <span class="Typ">
     {{Typ}}
    </span>
   </td>
  </tr>  {{/Typ}}
 </table> {{#Typ}}
 <hr/>
 {{/Typ}}
 {{^Typ}}
 {{#Effect}}
 <hr/>
 {{/Effect}}
 {{^Effect}}
 {{#Returns}}
 <hr/>
 {{/Returns}}
 {{/Effect}}
 {{/Typ}}
 <table>
  {{#Time complexity}}
  <tr>
   <td>
    <span class="Time_complexity">
     Time complexity
    </span>
   </td>   <td>
    <span class="Time_complexity">
     {{Time complexity}}
    </span>
   </td>
  </tr>  {{/Time complexity}}
  {{#Space complexity}}
  <tr>
   <td>
    <span class="Space_complexity">
     Space complexity
    </span>
   </td>   <td>
    <span class="Space_complexity">
     {{Space complexity}}
    </span>
   </td>
  </tr>  {{/Space complexity}}
 </table> {{#Space complexity}}
 <hr/>
 {{/Space complexity}}
 {{^Space complexity}}
 {{#Time complexity}}
 <hr/>
 {{/Time complexity}}
 {{/Space complexity}}
 {{#Exception2}}
 <span class="Exception">
  Exceptions
 </span> :
 <ol>
  {{#Exception}}
  <li>
   <span class="Exception">
    {{Exception}}
   </span>
  </li>  {{/Exception}}
  <li>
   <span class="Exception">
    {{Exception2}}
   </span>
  </li>  {{#Exception3}}
  <li>
   <span class="Exception">
    {{Exception3}}
   </span>
  </li>  {{/Exception3}}
  {{#Exception4}}
  <li>
   <span class="Exception">
    {{Exception4}}
   </span>
  </li>  {{/Exception4}}
 </ol> {{/Exception2}}
 {{^Exception2}}
 {{#Exception}}
 <span class="Exception">
  Exception
 </span> :
 <span class="Exception">
  {{Exception}}
 </span> <hr/>
 {{/Exception}}
 {{/Exception2}}
 {{#Example}}
 <li>
  <span class="Example">
   Example
  </span>  :
  <span class="Example">
   {{Example}}
  </span>  <br/>
 </li> {{/Example}}
 <footer>
  <p>
   <span class="Variables">
    {{Variables}}
   </span>
  </p>  {{#Assuming}}
  <span class="Assuming">
   Assuming
  </span>  :
  <span class="Assuming">
   {{Assuming}}
  </span>  <br/>
  {{/Assuming}}
  {{^Context}}
  <p>
   <span class="Deck">
    {{Deck}}
   </span>
  </p>  {{/Context}}
 </footer>
</span>

